import React from 'react'
import homeStore from '../stores/homeStore';
import {Link} from 'react-router-dom';

const Home = () => {

const store = homeStore()

React.useEffect(() => {
    store.fetchCoins()
}, [])

  return (
    <div>
        <input type='text' value={store.query} onChange={store.setQuery} />
        {store.coins.map(coin => {
            return(
                <div key={coin.id}>
                    <Link to={`/${coin.id}`}>
                        {coin.name}
                    </Link>
                </div>
            )
        })}
    </div>
  )
}

export default Home;
